    public int lengthOfLongestSubstringArr(String s) {
        int longestLength = 0, count = 0;
        int[] chars = new int[95]; // number of characters
        StringBuilder sb = new StringBuilder();
        for(int i = 0; i < s.length(); i++) {
            sb.append(s.substring(i));
        }
        String str = sb.toString();
        for(char _c : str.toCharArray()) {
            if(chars[_c-32] != 0) {
                if (count > longestLength) longestLength = count;
                chars = new int[95];
                chars[_c-32] = 1;
                count = 1;
            }
            else {
                chars[_c-32] = 1;
                count++;
            }
        }
        if (count > longestLength) longestLength = count;
        chars = new int[95];
        count = 0;
        return longestLength;
    }

    public int lengthOfLongestSubstringHM(String s) {
        int longestLength = 0, count = 0;
        HashMap<String, Integer> hm = new HashMap<>();
        for(int i = 0; i < s.length(); i++) {
            String str = s.substring(i);
            for(char _c : str.toCharArray()) {
                if(hm.containsKey(_c+"")) {
                    if (count > longestLength) longestLength = count;
                    hm.clear();
                    hm.put((_c+""), 1);
                    count = 1;
                }
                else {
                    hm.put((_c+""), 1);
                    count++;
                }
            }
            if (count > longestLength) longestLength = count;
            hm.clear();
            count = 0;
        }
        return longestLength;
    }
